import axios from "axios";

function Test(){
    console.log(Date)
    const date = "2022-03-12"
    const endDate = "2022-04-12"

    useEffect(() => {

        async function getWorkdays() {
            try {
                const result = await axios.get("https://working-days.p.rapidapi.com/analyse",
                    {
                        country_code: 'NL',
                        start_date: date,
                        end_date: endDate,
                    },
                    {
                        'X-RapidAPI-Key': '7ab2a76c92msh8d3b37609c76359p13c5a9jsn6d16127b4146',
                        'X-RapidAPI-Host': 'working-days.p.rapidapi.com'
                    });
                console.log(result.data.result.working_days.total);
            } catch (e) {
                console.error(e);
            }
        }
        getWorkdays();
    }, []);




